import React from "react";
import { BrowserRouter as Router } from 'react-router-dom';
import { Nav } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
        <Router>
            <Nav id="navigation" as="ul" className="navbar navbar-inverse menu-background sht-navbar">

                <div className="navbar-header">
                    <button type="button" className="navbar-toggle pull-left" data-toggle="collapse" data-target="#myNavbar" title="Menu">
                        <i className="fa fa-bars fa-lg fa-menu-white" aria-hidden="true"></i>
                    </button>
                </div>


                <div className="collapse navbar-collapse" id="myNavbar">
                    <ul className="nav navbar-nav">
                        <li className="">
                            <a href="/default" title="Home" className="">
                                <i class="fa fa-home fa-lg" aria-hidden="true">
                                    <img id="ImgHome" src={require("../../images/home.gif")} alt="Home icon" /> 
                                </i>
                            </a>
                        </li>
                    </ul>
                </div>
            </Nav>
        </Router>
    )
  }
} 

export default CommunicatorNavigation;
